import React, { useState } from 'react';

export default function Navbar(props) {
  // State for managing dark mode
  const [darkMode, setDarkMode] = useState(false);

  // Function to toggle dark mode
  const toggleDarkMode = () => {
    setDarkMode(!darkMode);
    // Add logic to toggle dark mode styles if necessary
  };

  return (
    <nav className={`navbar navbar-expand-lg ${darkMode ? 'navbar-dark bg-dark' : 'navbar-light bg-light'}`}>
      <div className="container-fluid">
        <a className="navbar-brand" href="https://tauqeerahmad5201.github.io/react-textutils/">{props.title}</a>
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarSupportedContent">
          <ul className="navbar-nav me-auto mb-2 mb-lg-0">
            <li className="nav-item">
              <a className="nav-link active" aria-current="page" href="#">{props.home}</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="https://github.com/yourGithubUsername">{props.about}</a>
            </li>
          </ul>
          {/* Dark mode toggle button */}
          <div className="form-check form-switch">
            <input className="form-check-input" type="checkbox" id="darkModeToggle" checked={darkMode} onChange={toggleDarkMode} />
            <label className="form-check-label" htmlFor="darkModeToggle">Dark Mode</label>
          </div>
        </div>
      </div>
    </nav>
  );
}
